import logo from "./logo.svg";
import "./App.css";
import FormComponent from "./components/Form/FormComponent";

function App() {
  return (
    <div className="App">
      <Routes>
        <Route path="/" element={<FormComponent />} />
      </Routes>
    </div>
  );
}

export default App;
